        var canvas = document.getElementById("renderCanvas");

        var createScene = function () {
            // This creates a basic Babylon Scene object (non-mesh)
            var scene = new BABYLON.Scene(engine);

            // This creates and positions a universal camera (non-mesh)
            var camera = new BABYLON.UniversalCamera('camera1', new BABYLON.Vector3(25, 20, -10), scene);
            camera.setTarget(new BABYLON.Vector3(0, -8, 4));
            camera.attachControl(canvas, true);
            camera.keysUp.push(87);    // W
            camera.keysDown.push(83)   // D
            camera.keysLeft.push(65);  // A
            camera.keysRight.push(68); // S

            // This attaches the camera to the canvas
            camera.attachControl(canvas, true);

            // This creates a light, aiming 0,1,0 - to the sky (non-mesh)
            var light = new BABYLON.HemisphericLight("light", new BABYLON.Vector3(0, 1, 0), scene);

            // Default intensity is 1. Let's dim the light a small amount
            light.intensity = 0.7;

            var faceColors = new Array(6);
            var brown = new BABYLON.Color4(0.72, 0.5, 0.33, 1);
            faceColors[4] = brown;   // top
            faceColors[5] = brown;   // bottom
            var blue = new BABYLON.Color4(0, 0, 1, 1);
            var boxes = panels.map(p => {
                var pbox = BABYLON.MeshBuilder.CreateBox(p.id, { width: p.width, height: p.height, depth: p.depth, faceColors: faceColors }, scene);
                pbox.position.x = p.x;
                pbox.position.y = p.y;
                pbox.position.z = p.z;
                pbox.enableEdgesRendering();
                pbox.edgesWidth = 1.0;
                pbox.edgesColor = blue;
                pbox.wireframe = false;
                pbox.sourcePanel = p;
                return pbox;
            });
			
			var advancedTexture = BABYLON.GUI.AdvancedDynamicTexture.CreateFullscreenUI("UI");

			var text1 = new BABYLON.GUI.TextBlock();
			text1.text = "Use the mouse and keys W,A,S,D to navigate";
			text1.color = "white";
			text1.fontSize = 24;
			advancedTexture.addControl(text1);
			window.setTimeout(function() {
				advancedTexture.removeControl(text1);
			}, 5000);

            return scene;
        };

        var engine = new BABYLON.Engine(canvas, true, { preserveDrawingBuffer: true, stencil: true });
        var scene = createScene();

        engine.runRenderLoop(function () {
            if (scene) {
                scene.render();
            }
        });

        canvas.addEventListener('click', () => {
            // We try to pick an object
            const result = scene.pick(scene.pointerX, scene.pointerY);
            if (result.hit && !!result.pickedMesh) {
                console.log(result.pickedMesh.sourcePanel);
            }
        });

        // Resize
        window.addEventListener("resize", function () {
            engine.resize();
        });
    </script>
